import React from "react";
import { useSelector } from "react-redux";

export default function Status() {
    const full_data = useSelector(state => state);

    const [inf, setInf] = React.useState([])

    React.useEffect(() => {

        console.log('ss',  full_data)
        full_data.then(
            res=> {
                setInf(res.json())
                console.log('inf', inf)
            }
        )

    }, [inf]);


    return (
        <div className="status">
            <p>Статус: <span>{}</span></p>
        </div>
    );
}
